import axios from "axios";

export const yahooFinApi = axios.create({
  baseURL: "https://yfapi.net",
  headers: {
    accept: "application/json",
    "X-API-KEY": "geRnN92Dsx42JwSByyDLi5YICPKBzX654KLzh4db",
  },
});
